    const [randNum, setRandNum] = useState(1);

    return (
        <div className={styles.profile}>
            <img src={`https://api.hello-avatar.com/adorables/285/${randnum}`} alt='User Avatar'/>
            <label><b>Nigger</b></label>
            <p>Nigger@niggerino.com</p>
            <button className={styles.avatarbtn} onClick={randNum}>Toggle avatar</button>

        </div>
    );
};

export default Profile;
